$(window).load(function () {
    //Init json content of the text 
    $("pre[data-name='code']", $("div[data-name='MotionDetection']")).html("<table><tr><td>Start Time</td><td>End Time</td><td>In Region</td></tr><tr><td>1.9</td><td>3.6</td><td>0</td></tr><tr><td>4.7</td><td>15.2</td><td>0</td></tr></table>");

    BuildPopUpStep("MotionDetection", MotionDetectionStepInfo);

    var video3 = $("video", $("div[data-name='MotionDetection']")).get(0);
    if (!video3) {
        return;
    }
    video3.volume = 0;
    var volumeValue3 = $("div[data-name='volumeValue']", $("div[data-name='MotionDetection']"));
    volumeValue3.css("height", video3.volume * 100 + "%");
    video3.addEventListener('playing', function () {
        $(this).show();
        $("div[data-name='ImgDiv']", $("div[data-name='MotionDetection']")).addClass("displaynone")
        $("div[data-name='loading_icon']", $("div[data-name='MotionDetection']")).addClass("displaynone")
    });
    video3.addEventListener('timeupdate', function () {
        var currentPos = video3.currentTime; //Get currenttime
        $(".currentTime", $("div[data-name='MotionDetection']")).html(GetHMSFormat(currentPos));
        var maxduration = video3.duration; //Get video duration
        var percentage = currentPos / maxduration * 100; //in %
        $('.timeBar', $("div[data-name='MotionDetection']")).css('width', percentage + '%');

        if (percentage >= 100) {
            $("div[data-name='PlayOrPause']", $("div[data-name='MotionDetection']")).removeClass("Pause-Style");
            $("div[data-name='PlayOrPause']", $("div[data-name='MotionDetection']")).addClass("Play-Style");
            video3.pause();
            video3.currentTime = 0;
            $('.timeBar', $("div[data-name='MotionDetection']")).css('width', '0%');
        }
        else if (!video3.paused) {
            $("div[data-name='PlayOrPause']", $("div[data-name='MotionDetection']")).removeClass("Play-Style");
            $("div[data-name='PlayOrPause']", $("div[data-name='MotionDetection']")).addClass("Pause-Style");
        }
    });

    video3.addEventListener('loadedmetadata', function () {
        BuildPopUpStep("MotionDetection", MotionDetectionStepInfo);
    });

    var timeDrag3 = false;   /* Drag status */
    $('.progressBar', $("div[data-name='MotionDetection']")).mousedown(function (e) {
        timeDrag3 = true;
        updatebar3(e.pageX);
    });
    $('.progressBar', $("div[data-name='MotionDetection']")).mouseup(function (e) {
        if (timeDrag3) {
            timeDrag3 = false;
            updatebar3(e.pageX);
        }
    });
    $('.progressBar', $("div[data-name='MotionDetection']")).mousemove(function (e) {
        if (timeDrag3) {
            updatebar3(e.pageX);
        }
    });
    //update Progress Bar control
    var updatebar3 = function (x) {
        var progress = $('.progressBar', $("div[data-name='MotionDetection']"));
        var maxduration = video3.duration; //Video duraiton
        var position = x - progress.offset().left; //Click pos
        var percentage = 100 * position / progress.width();

        //Check within range
        if (percentage > 100) {
            percentage = 100;
        }
        if (percentage < 0) {
            percentage = 0;
        }

        //Update progress bar and video currenttime
        $('.timeBar', $("div[data-name='MotionDetection']")).css('width', percentage + '%');
        video3.currentTime = maxduration * percentage / 100;
    };

    var volumeDrag3 = false;
    $("div[data-name='volumeData']", $("div[data-name='MotionDetection']")).mousedown(function (e) {
        volumeDrag3 = true;
        volumeBar3(e.pageY)
    });
    $("div[data-name='volumeData']", $("div[data-name='MotionDetection']")).mouseup(function (e) {
        if (volumeDrag3) {
            volumeDrag3 = false;
            volumeBar3(e.pageY);
        }
    });
    $("div[data-name='volumeData']", $("div[data-name='MotionDetection']")).mousemove(function (e) {
        if (volumeDrag3) {
            volumeBar3(e.pageY);
        }
    });
    var volumeBar3 = function (y) {
        var volumeData = $("div[data-name='volumeData']", $("div[data-name='MotionDetection']"));
        var position = y - volumeData.offset().top;
        var maxHeight = volumeData.height();
        var percentage = (maxHeight - position) / maxHeight;
        if (percentage > 1) {
            percentage = 1;
        }
        if (percentage < 0.01) {
            percentage = 0;
        }
        video3.volume = percentage;
        $("div[data-name='volumeValue']", $("div[data-name='MotionDetection']")).css('height', (percentage * 100).toFixed(0) + '%');
        if (percentage == 0) {
            $("div[data-name='volumeIcon']", $("div[data-name='MotionDetection']")).css("background-image", "url(" + window.applicationRoot + "/Modules/Microsoft.ProjectOxford.Website.Demos/Images/video/Volume0.png)");
        }
        else if (percentage > 0 && percentage <= 0.33) {
            $("div[data-name='volumeIcon']", $("div[data-name='MotionDetection']")).css("background-image", "url(" + window.applicationRoot + "/Modules/Microsoft.ProjectOxford.Website.Demos/Images/video/Volume1.png)");
        }
        else if (percentage > 0.33 && percentage <= 0.66) {
            $("div[data-name='volumeIcon']", $("div[data-name='MotionDetection']")).css("background-image", "url(" + window.applicationRoot + "/Modules/Microsoft.ProjectOxford.Website.Demos/Images/video/Volume2.png)");
        }
        else {
            $("div[data-name='volumeIcon']", $("div[data-name='MotionDetection']")).css("background-image", "url(" + window.applicationRoot + "/Modules/Microsoft.ProjectOxford.Website.Demos/Images/video/Volume3.png)");
        }
    };
});

$(window).resize(function () {
    BuildPopUpStep("MotionDetection", MotionDetectionStepInfo);
});

var popUpArray = {};

function BuildPopUpStep(dataName, stepInfo) {
    popUpArray = {};
    //var video = $("video", $("div[data-name='" + dataName + "']")).get(0);
    var timeBar = $('.timeBar', $("div[data-name='" + dataName + "']"));
    var progressBarWidth = $('.progressBar', $("div[data-name='" + dataName + "']")).width();
    //var maxduration = video.duration; //Get video duration
    var left, width;

    var html = "";
    //var timescale = stepInfo.timescale;
    var maxlength;
    if (stepInfo.fragments != null && stepInfo.fragments != undefined && stepInfo.fragments.length > 0) {
        maxlength = stepInfo.fragments[stepInfo.fragments.length - 1].start + stepInfo.fragments[stepInfo.fragments.length - 1].duration;
        for (var i = 0, j = 0; i < stepInfo.fragments.length; i++) {
            var oneStep = stepInfo.fragments[i];
            if (oneStep.events != null && oneStep.events != undefined) {
                left = (oneStep.start / maxlength * progressBarWidth).toFixed(0);
                width = (oneStep.duration / maxlength * progressBarWidth).toFixed(0);
                if (left >= (progressBarWidth - 5)) {
                    left = (progressBarWidth - 5).toFixed(0);
                }           
                var option = {};
                option.start = parseInt(left);
                option.end = parseInt(left) + parseInt(width);
                popUpArray[j] = option;
                j++;
                popUpArray.length = j;
            }
        }
    }
    timeBar.html(html);
}